import'./component_css/Component.css'
function Introtext() {
    return (
<div className="kotakintrotext">
  <h1 className="introtext">Hi..developer <br/> Welcome to my portofolio</h1>
  <p class="paragraftintro">Sebelum itu saya mau memperkenalkan nama saya <em>'Rivaldo Bogar'</em>, Saya jika
                dikategorikan di dunia IT, Saya adalah seorang programmer pemula.<br/>
                Saya sekarang sedang berkuliah di Sulawesi Utara, Tepatnya di Aermadidi kampus : <em>( UNIVERSITAS
                    KLABAT ).</em><br/>
                Saya ingin mengucapkan terima kasih buat kalian yang sudah berkunjung.</p>
</div>
    )
};
export default Introtext;
